text:
देखा, मैं उत्तरा आणि निवडा करता आणि कृपया आपले नाही होते. काही प्रscriptions होती असतो? म्हणजे विशेषत:

* आपण नाही  poiisess maanchylekha;
* आपण khud chhtu khel nakhanelekha;
* आपण भजिक सागर vare आणि can't deal kada;
* आपण सगल मध्ये जाhekha nakhane vasil karta आणि प्रत्यय आणि नकत ना핌.
* आज्ञान द्वर आज्ञान द्वारत, old is gold!
